function generateGrid(){var t=Math.abs(Alpine.store("settings").base),s=Math.abs(Alpine.store("settings").grid_base),n=Math.abs(Alpine.store("settings").iterations);let i=[];for(let e=1;e<=n;e++){var l=s*e;i.push({p:l,e:l/t,r:l/t})}Alpine.store("settings").grids=i}!function(){"use strict";(window.Raven=window.Raven||{}).elements={util_class:document.getElementById("util-class")}}(),generateUtilClasses=()=>{var t=Alpine.store("settings").grids,s=(document.getElementById("util-class"),Alpine.store("settings").util_class_prefix);let n="";for(let e=0;e<=t.length-1;e++){var i=t[e];n+=`.${s}${i.p} { ${i.r}rem }`+"\r\n\n"}Raven.elements.util_class.innerText=n,Raven.elements.util_class.style.display="inherit",hljs.highlightElement(Raven.elements.util_class)};